  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Montezuma National
  Wildlife Refuge outlines Refuge accomplishments from September through December
  of 1957. The report begins by summarizing the weather conditions, water conditions,
  and food and cover during this period. Wildlife- including migratory birds, upland
  game birds, big game animals, furbearers, predators, rodents, raptors, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments, plantings, collections and receipts, vegetation control, and wildfires.
  Resource management is outlined; topics include grazing. A progress report on field
  investigations and applied research is also provided. The public relations section
  of the report describes recreational uses, Refuge visitors, refuge participation,
  and violations. Photographs and N-R forms are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
